import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllEmplyees } from "../../actions/adminActions";

const AllEmployees = () => {
  const dispatch = useDispatch();

  const Employees = useSelector((state) => state.allEmployees);
  const [keyword, setKeyword] = useState("");

  console.log(Employees);

  useEffect(() => {
    dispatch(getAllEmplyees());
  }, []);

  const handleSubmit = () => {};
  return (
    <div>
      <div className="middle">
        <form onSubmit={handleSubmit}>
          <input type="text" onChange={(e) => setKeyword(e.target.value)} />
          <button type="submit">Search</button>
          <button type="submit">Filter</button>
        </form>
      </div>

      <div className="bottom">
              {Employees
                ? Employees?.data?.map((dt) => {
                    return (
                      <div key={talent?.owner?._id} className="talent-result">
                        <div className="t-left">
                          <img
                            src={
                              talent?.image
                                ? talent?.image
                                : "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg"
                            }
                            alt=""
                          />
                          <div>
                            <p style={{ color: "#3ccf4e" }}>
                              {talent?.owner?.name}
                            </p>
                            <h4>{talent?.userTitle.slice(0, 20)}. . .</h4>
                            <p>
                              total earend:{" "}
                              <strong>{talent?.totalEarned}</strong>
                            </p>
                          </div>
                        </div>

                        <div className="t-right">
                          <BookmarkBorderIcon
                            onClick={() => {
                              dispatch(saveTalents(talent?.owner?._id));
                              setAlret(true);
                              setTimeout(() => {
                                setAlret(false);
                              }, 1000);
                            }}
                            style={{ color: "#3ccf4e", cursor: "pointer" }}
                          />
                          <button>
                            {" "}
                            <Link to={`/user/publicView/${talent?.owner._id}`}>
                              {" "}
                              View Profile
                            </Link>
                          </button>
                        </div>
                      </div>
                    );
                  })
                : ""}
            </div>
    </div>
  );
};

export default AllEmployees;
